CREATE TABLE Station (
    S_ID       INTEGER      PRIMARY KEY,
    S_Location VARCHAR(100) NOT NULL,
    S_Height   INTEGER
);

CREATE TABLE Measurement (
    M_Date        DATETIME,
    M_Station     INTEGER,
    M_Temperature DECIMAL(4,1),  -- xxx.x
    PRIMARY KEY (M_Date, M_Station),
    FOREIGN KEY (M_Station) REFERENCES Station(S_ID)
);



SELECT S_ID, S_Location, COUNT(*) AS Count, COUNT(M_Temperature) AS TempCount
FROM Station INNER JOIN Measurement ON (S_ID = M_Station)
GROUP BY S_ID, S_Location
ORDER BY S_ID;
